#include "reimpl2.h"
#include <stdio.h>
#include <stdlib.h>

#define NUMROUNDS (1 << 24)

void decrypt(int *data, int *dest, int len, int k1, int k2) {
  int i;
  for (i = 0; i < len; i++) {
    int txt = data[i];
    int l, r;
    l = (txt >> 12) & ((1 << 12) - 1);
    r = txt & ((1 << 12) - 1);
    int x;
    for (x = 0; x < NUMROUNDS; x++) {
      int y = NUMROUNDS - x - 1;
      if (y % 2 == 0) {
        int r0 = l;
        int k = 0;
        if (y & 1) k = k2;
        else k = k1;
        int l0 = r ^ sbox1[k ^ l];
        l = l0; r = r0;
      } else {
        int l0 = l;
        int k = 0;
        if (y & 1) k = k2;
        else k = k1;
        int r0 = sboxInv2[l ^ r] ^ k;
        l = l0; r = r0;
      }
    }
    dest[i] = (l << 12) | r;
  }
}

void encrypt(int *data, int *dest, int len, int k1, int k2) {
  int i;
  for (i = 0; i < len; i++) {
    int txt = data[i];
    int l, r;
    l = (txt >> 12) & ((1 << 12) - 1);
    r = txt & ((1 << 12) - 1);
    int x = 0;
    for (x = 0; x < NUMROUNDS; x++) {
      if (x % 2 == 0) {
        int l1 = r;
        int r1 = l ^ sbox1[k1 ^ r];
        l = l1;
        r = r1;
      } else {
        int l1 = l;
        int r1 = l ^ sbox2[k2 ^ r];
        l = l1; r = r1;
      }
    }
    dest[i] = (l << 12) | r;
  }
}

int main(int argc, const char **argv) {
  int k1 = atoi(argv[1]);
  int k2 = atoi(argv[2]);
  int len = 0;
  scanf("%d", &len);
  int *pool = malloc(sizeof(int) * len);
  int i;
  for (i = 0; i < len; i++)
    scanf("%d", &pool[i]);
  encrypt(pool, pool, len, k1, k2);
  for (i = 0; i < len; i++)
    printf("%d\n", pool[i]);
}


